"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Kawasaki disease (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/kawasaki-disease-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H13205766\">",
"      <span class=\"h1\">",
"       What is Kawasaki disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Kawasaki disease causes inflammation in certain blood vessels in the body. The main symptoms are fever, and swelling and redness in the areas with inflammation. It is most common in children under 5 years old.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13205781\">",
"      <span class=\"h1\">",
"       What causes Kawasaki disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The cause is not known. But doctors don&rsquo;t think it spreads from person to person.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13205796\">",
"      <span class=\"h1\">",
"       What are the symptoms of Kawasaki disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The symptoms include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Fever",
"       </li>",
"       <li>",
"        Redness in the white part of the eye",
"       </li>",
"       <li>",
"        Cracked, red lips",
"       </li>",
"       <li>",
"        A red, swollen tongue",
"       </li>",
"       <li>",
"        A rash - The rash often starts in the genital area. It can also be on the back, chest, belly, arms, and legs.",
"       </li>",
"       <li>",
"        Swollen glands in the neck",
"       </li>",
"       <li>",
"        Swollen, red skin on the palms of the hands and soles of the feet",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13205811\">",
"      <span class=\"h1\">",
"       Is there a test for Kawasaki disease?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Your doctor or nurse should be able to tell if your child has Kawasaki disease by learning about his or her symptoms and doing an exam. But some children with Kawasaki disease need tests. These can include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        A blood test",
"       </li>",
"       <li>",
"        A urine test",
"       </li>",
"       <li>",
"        An ultrasound of the heart (&ldquo;echocardiogram&rdquo;) &ndash; This test creates pictures of the heart as it beats.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H13205826\">",
"      <span class=\"h1\">",
"       How is Kawasaki disease treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Treatments for Kawasaki disease include:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        Gamma globulin - This treatment goes into a vein through a tube called an &ldquo;IV.&rdquo; This is done in a hospital over a period of 8 to 12 hours.",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        <a class=\"drug drug_patient\" href=\"UTD.htm?6/12/6342?source=see_link\">",
"         Aspirin",
"        </a>",
"       </li>",
"      </ul>",
"     </p>",
"     <p>",
"      If your child gets gamma globulin, he or she might not be able to get certain vaccines (such as for measles or chicken pox) for at least 1 year. That&rsquo;s because the vaccines might not work as well during this time to prevent disease.",
"     </p>",
"     <p>",
"      Children with Kawasaki disease who don&rsquo;t get treatment are at risk for heart problems. That&rsquo;s because they can have swelling of the blood vessels in the heart. But only a few children have lasting heart damage from Kawasaki disease.",
"     </p>",
"    </div>",
