"    Relative survival among 4426 Merkel cell carcinoma patients by number",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 537px; height: 320px; background-image: url(data:image/gif;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Relative survival among 4426 Merkel cell carcinoma patients by node status. Percent relative survival was calculated for cases in the National Cancer Database using age- and sex-matched control data from the Centers for Disease Control and Prevention. Relative survival curves shown are divided into node negative patients (top two lines), node status unknown (middle line), and node positive patients (bottom two lines). The curve indicated by \"Node positive pathologically\" includes pathologic node positive patients with clinical node status negative or unknown. Total number of patients was 4426, and individual groupings were as follows: node negative microscopically = 630, node negative clinically = 1726, node status unknown = 1134, node positive pathologically = 794, node positive clincially = 143.",
"    <div class=\"footnotes\">",
"    </div>",
